import styled from "styled-components";

export const StyledHome = styled.div`
  display: flex;
  align-content: center;
  h1,
  h5 {
    color: #fefefe;
    margin: 0 0;
    padding: 0 0;
    border: solid blue;
  }

  h1 {
    font-size: 135px;
  }

  h5 {
    font-size: 50px;
  }
  img {
    height: 30em;
  }
`;
